import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import DashBoard from './Dashboard/dashboard';
import ApiKeys from './API Keys/apikeys';
import Sdk from './SDKs/sdk';
import Deployments from './Deployments/deployments';
import Wizard from './Wizard/wizard';
import './index.css';

function MainContent() {
  return (
    <BrowserRouter>
      <div className='main-container'>
        {/* Specify your routes without using Switch */}
        <Route exact path='/dashboard' component={DashBoard} />
        <Route exact path='/apikeys' component={ApiKeys} />
        <Route exact path='/sdk' component={Sdk} />
        <Route exact path='/deployments' component={Deployments} />
        <Route exact path='/wizard' component={Wizard} />
      </div>
    </BrowserRouter>
  );
}

export default MainContent;
